('comment', 'comment_node_forum', 0, 15, 15, 'und', 0, 'Interdum et malesuada fames ac ante ipsum primis in faucibus. Praesent adipiscing eget ipsum porttitor hendrerit. Etiam facilisis justo massa, et rhoncus est dignissim vel. Pellentesque iaculis tortor non magna ultrices blandit. Donec lobortis vulputate vestibulum! Ut id quam ullamcorper massa nunc.\r\n', 'filtered_html'),
('comment', 'comment_node_forum', 0, 16, 16, 'und', 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla faucibus velit quis nunc semper, eget egestas nunc hendrerit. Praesent tincidunt, purus non vehicula pharetra, urna urna molestie velit, eget aliquet est nibh a massa. Curabitur condimentum eu elit sed aliquet! Nullam at tincidunt metus.\r\n', 'filtered_html');
INSERT INTO `field_data_field_bio` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_bio_value`, `field_bio_summary`, `field_bio_format`) VALUES
('user', 'user', 0, 1, 1, 'und', 0, 'A short professional bio has become increasingly important as most of us suffer from information fatigue and cannot be bothered to read lengthy documents about anybody. Experts such as Matthew Levy reckon your bio is the most important document you will ever write.\r\n\r\nA bio is useful for a host of reasons such as applying for a job, publishing an article or guest blog post, general networking etc. It’s basically a great vehicle for quickly communicating who you are and what you do.\r\n\r\nYou are likely to have a bio somewhere on the Internet already. If you write a blog, it will be your About page. If you are on LinkedIn, it will be your summary. If you are on Twitter, it will be your, wait for it… Bio! These three most probably have different lengths, with the minnow being Twitter that only allows for a 140 character bio.\r\n\r\nAs writing a professional bio is the hottest thing since sliced bread, you best get on with it and follow these simple steps to do your personal brand proud. Here are the a few tips followed by a sample bio by Chris Brogan.\r\n', '', 'filtered_html'),
