('node', 'article', 0, 2, 2, 'und', 0, 'Consider this a friendly reminder of what really matters — the place you call home. For traders, home is their desk. It''s where markets happen (and markets = life). That''s why we asked our readers to send us photos of their desks to check out how people are doing this all over the world.\r\n\r\nThey obliged, and we put the photos together in this slideshow. We''re ready for another installment, though, so e-mail your trading desk set-up to jlaroche@businessinsider.com or llopez@businessinsider.com\r\n\r\nUntil then, check out these trading spaces.\r\n\r\n<a href="http://www.businessinsider.com/trading-desk-photos-2014-4?op=1#ixzz2zb5W5OZZ">Read more</a>\r\n', '', 'full_html'),
('node', 'article', 0, 3, 3, 'und', 0, 'Apple, unlike any other company in the world, has its identity tied to one individual: Steve Jobs.\r\n\r\nAnd without question, Jobs was the driving force that turned Apple into the world''s most valuable tech company.\r\n\r\nBut, Jobs didn''t do it alone.\r\n\r\nWe decided to take a look at the first 10 employees at Apple, and see what they did and where they are today.\r\n\r\nApple''s first CEO, Michael Scott, gave us a bunch of color on the early days, and Steve Wozniak helped with a list of early employees, though it was based on his memory. We got our full list from another early employee. \r\n\r\nThe Apple employee numbers aren''t the order each person joined the company. When Scott came to Apple he had to give out numbers to each employee to make life easier for the payroll department.\r\n\r\n<a href="http://www.businessinsider.com/the-first-10-apple-employees-2014-4?op=1#ixzz2zb70weFc">Read more</a>\r\n', '', 'full_html'),
('node', 'article', 0, 4, 4, 'und', 0, 'The suiting gods from on-high have decided that double-breasted suits are back this spring.\r\n\r\nImagine a well-tailored English gentleman got his hands on a 1920s gangster''s suit and decided he could wear the jacket with a pair of jeans.\r\n\r\nIn other words, there are levels to this stuff.\r\n\r\nThis isn''t your grandfather''s double-breasted jacket and we strongly (strongly) suggest you forget the fedora. You''re going to want to bring this style into 2014 the right way.\r\n\r\nTo elaborate on this, Business Insider caught up with Judah Estreicher, founder of JBD Clothiers, for the run down on how to do that. JBD is a Baltimore-based men''s custom clothing shop that suits businessmen and Baltimore Ravens alike.\r\n\r\nThe key with the modern double-breasted look, Estreicher told us, is that it''s shorter and slimmer than the traditional cut.\r\n\r\nYou should be able to wear it casually in Spring and Summer too, so think lighter colors — gray, dark blue, white.\r\n\r\n"But casual or not," said Estreicher, "the double-breasted pitfall will always be the cut and fit. Look out for the bulk of the extra fabric and the boxiness of the shoulders. For best look and fit, consult with a tailor. This is a fit that can be more complex than the regular 1 button suit and will benefit from some expert advice and touch ups to the waist area."\r\n\r\nSo, unless you have your jacket custom-fitted, make sure someone with a tailor''s eye gives your jacket a second look. There''s no point in doing this unless it''s done right.\r\n\r\n<a href="http://www.businessinsider.com/how-to-wear-a-double-breasted-jacket-2014-4#ixzz2zb6XL4tH">Read more</a>\r\n', '', 'full_html'),
('node', 'article', 0, 5, 5, 'und', 0, 'Just in case you don''t already have enough restaurants on your hit list, we''ve uncovered even more cool places for you to try out.\r\n\r\nFrom restaurants in secret alleyways to eateries located behind everyday storefronts, you''ll be surprised to learn about these hidden dining establishments.\r\n\r\nSo, what are you waiting for? Click through for our guide to secret restaurants in NYC, and let the adventures begin!\r\n\r\n<a href="http://guestofaguest.com/new-york/restaurants/nycs-hidden-restaurants-10-secret-spots-revealed#ixzz2zb7D9uTk">Read more</a>\r\n', '', 'full_html'),
('node', 'article', 0, 6, 6, 'und', 0, 'Americans sit through some 11 million meetings every day — with the unproductive ones costing companies $37 billion a year. \r\n\r\nSince we''ve already looked at the most egregious meeting mistakes, we decided to explore how the most successful executives run effective meetings. \r\n\r\nAfter combing through the business literature, we discovered that Yahoo''s Marissa Mayer grills her employees like an expert chef, Amazon''s Jeff Bezos can''t stand it when people agree, and Facebook''s Sheryl Sandberg wields a mighty notebook. \r\n\r\nDisclosure: Jeff Bezos is an investor in Business Insider through his personal investment company Bezos Expeditions.\r\n\r\n<a href="http://www.businessinsider.com/how-elon-musk-jeff-bezos-run-meetings-2014-4?op=1#ixzz2zb7n0Nz2">Read more</a>\r\n', '', 'full_html'),
('node', 'article', 0, 7, 7, 'und', 0, 'With May right around the corner, U.S. college graduates will be migrating to the nation''s biggest cities to try to find jobs and apartments and to start life on their own.\r\n\r\nNiche Ink, a website dedicated to education analysis, put together a list of the best metro areas for millennials. They ranked the metro areas in the U.S. using a dozen factors, including data from the U.S. Census, FBI crime rates, and Niche Ink user opinions on the best places for life after graduation. They then calculated the best neighborhood for young people in each of those cities. (You can read the full methodology here.)\r\n\r\nKeep reading to see the top 25 cities and neighborhoods in the U.S. for millennials.\r\n\r\n<a href="http://www.businessinsider.com/best-neighborhoods-for-millennials-2014-4?op=1#ixzz2zb9ZQZ4L">Read more</a>\r\n', '', 'full_html'),
