('node', 'blog', 0, 40, 40, 'und', 0, 'Open source software has long been a natural choice for schools and educators teaching children about technology: both share an emphasis on exploration and collaboration, and access to free, open source technology can be a welcome relief to schools and parents.\r\n\r\nAt the Abraham Darby Academy in Telford, Shropshire, students between the ages of 11 and 16 are getting a lesson in open courseware while also teaching them about journalism. Their BBC School Report website is running on Drupal, and students use the CMS upload their articles and video journalism to their website— and in the process, they are gaining valuable experience both creating content and uploading it to the web.\r\n\r\nSaid Stephen Birch, a member of the Information Technology teaching staff at Abraham Darby Academy, “[The BBC School Report] enables students to ''make the news'' on School Report News Day (27th March 2014). [The students] report on stories that matter to them within a theme set by the BBC— this year it is ''computing'' (a very wide topic influenced by the new Computing curriculum that comes into force for all 5 - 16 year old students this September).\r\n\r\n"We chose to use Drupal to create the site as we could set it up in advance and give the students permissions to publish their work to it on the day. Being able to set up permissions so that the students can post without risk of ''taking the site down'' is very reassuring. Drupal''s front end also means the students do not have to spend hours learning how to upload the content— the word processing style interface is very familiar to them."\r\n\r\n<h4>Drupal in Advanced Classes</h4>\r\n\r\nThe website for the BBC School Report is the latest in a long series of Drupal deployments at the school. In an email to the Drupal Association, Birch discussed the students’ passing familiarity with Drupal.\r\n\r\n"We started using Drupal as a platform for our A-Level students to build websites for their assessments back in 2011,” he wrote. “Since then we have been using it for various projects, including our new school website that I''m developing to launch in September.”\r\n\r\nStudents enrolled in the A-Level Information and Communication Technology course at the Abraham Darby Academy are required to create a website according to customer specifications. The project takes students through every point in the system lifecycle, from initial contact with companies looking for solutions to delivery of the completed project.\r\n\r\nIn the class, students familiarize themselves with the development process, and deliver a live website, training schedules for end users and an owner’s manual— all of which they build as part of their schoolwork.\r\n\r\n"There is no requirement for the students to implement any original code,” wrote Birch. “It is the process that is being examined. That said, they do need to understand how to develop a solution and we have found that Drupal provides the framework to enable professional looking solutions in the timescales we have.”\r\n\r\n<h4>The Clear Choice</h4>\r\n\r\nWhen it came to a CMS to be used in the classroom, the school cycled through a variety of other solutions, including coding in Dreamweaver, or building websites in Joomla. But when a student needed better database integration, the research began.\r\n\r\n"A few of years ago one of the students needed a solution for a membership site and whilst looking at methods of implementing a membership database that could cope with paid membership and event solutions we came across the CiviCRM module. We tried it on Drupal and Joomla and Drupal won the day due to the support and advice available on the Drupal and CiviCRM forums! Since then we have never looked back.”\r\n\r\nFor the students, working with Drupal has become a valuable educational experience— and, as it turns out, they aren’t the only ones benefitting.\r\n\r\n"The feedback from students about Drupal has been generally positive and they soon get the hang of how to integrate the contributed modules and themes into their designs,” wrote Birch.\r\n\r\n"The ease of installing modules enables the students to produce non linear solutions to the customer requirements - this year it is looking like one of the clients is going to use the solution created as their business website.”\r\n\r\nIn the meantime, students will be working on their reports for the upcoming BBC News Day. What topics in computing will the students be reporting on?\r\n\r\nSaid Birch, "It would be great to use Drupal as a theme for one of our stories on news day.”\r\n\r\nDo you have a great story about Drupal? Submit a story idea or contact Leigh to let the Drupal Association know about it!\r\n\r\nFrom: Assoc.drupal.org. <a href="https://assoc.drupal.org/content/drupal-making-news-bbc-school-report" target="_blank">Click to see the full content.</a>', '', 'full_html'),
('node', 'blog', 0, 41, 41, 'und', 0, 'Preparing the materials for the monthly board meeting is a lot of work, but it''s a great chance to reflect each month on the momentum of the Association and the community. Looking back, March 2014 was particularly exciting as the community and staff are pushing forward in several directions at once with considerable momentum. So let''s get down to it and share some of the highlights:\r\n\r\n<h4>Program Updates</h4>\r\n\r\nEach month we review the metrics outlined in our 2014 Leadership Plan and share updates from the teams. We''re pleased to say that most of our metrics are in the green (within 95% of goal). Particularly exciting is the news about DrupalCon Austin. Numbers looked very solid at the end of March (the end of our reporting period for this meeting), but we are also able to share that early-bird pricing ended just a few days after this dashboard closed and we beat our estimates, meaning that we are more than on-track to have a 4,000 person event this June - another biggest DrupalCon ever!\r\n\r\nWe are also really pleased with the momentum around the Drupal.org metrics. This is still our area of greatest concern - we have more red metrics here than anywhere else. However, March brought some tremendous gains that, if sustained, will move our metrics quickly towards green. In particular, we focused discussion on:\r\n\r\n<ul><li>\r\n		<strong>Page Response Time: </strong>Our goal is 3.07 seconds. Our current average for the year is 3.93 seconds (This number is pulled from our Pingdom account). Part of the reason that we''re so far from goal is that we had some serious issues in January that pushed the numbers way up. Our hardware improvments (thanks to the DIWG and <a href="https://drupal.org/user/373733">Rudy</a>) have helped speed this up, and the upcoming CDN deployment will bring this number down even further, especially for individuals accessing the site outside of the US.&nbsp;</li>\r\n	<li>\r\n		<strong>Testbot performance:</strong> Goal is 70 minutes, but actual average for the year is about 138 minutes. This actual is also very inflated by lots of issues we had in January that pushed the total testbot time much higher. Thanks to work done at <a href="http://szeged2014.drupaldays.org/">Drupal Dev Days</a> in Szeged by <a href="https://drupal.org/user/148199">Jeremy Thorson</a> and <a href="https://drupal.org/user/666176">Ricardo Amaro</a>, along with some changes to D8 core, the actual tesbot run time average in March was just 47 minutes!</li>\r\n	<li>\r\n		<strong>Home Page Bounce Rate: </strong>This metric is one of the central motivations for the User Research that the DCWG has begun as part of a larger <a href="https://association.drupal.org/content/reinventing-drupalorg">Drupal.org reinvention</a>. We have also begun to put tools like Optimizely in place that will allow us to run tests and experiments based on our research, which should help us address bounce rate, time on site, and other engagement metrics for our various audiences. We likely won''s see shifts here for some months, but we are definitely thinking about these metrics and working to put the foundation for a solution in place.&nbsp;</li>\r\n</ul>\r\n\r\n<h4>\r\n	Procurement Policy</h4>\r\n\r\nAt the Association, we work hard to ensure that our actions are in line with the Drupal community values. This is, of course, particularly important when money is part of the equation. To that end, the Association has a Financial Policies document that is reviewed annually by the board Finance Committee and sets rules for transparently and openly making decisions for how Association money gets spent. Until now, one element that was lacking was a Procurement Policy to govern when we pay for a service (vs. work with a volunteer) and how and when we can take in-kind donations. Back in February, we looked for feedback from the community, and incorporated a lot of the suggestions into a final policy, which was approved by the board in the meeting. \r\n\r\nI would like to add that this policy, though approved by the board, is just a starting place. There is so much nuance that we will encounter as we put the policy into practice. During our annual review of policies, we will have the opportunity to revisit and refine this language. In particular, we want to ensure that we are supporting and growing the volunteers who contribute to the project and not hiring contractors at the expense of the health of our community.\r\n\r\n<h4>At-Large Elections/Terms</h4>\r\n\r\nIn the March Board meeting, we updated At-Large term length and shifted the election cycle. The goal is to give our At-Large Directors a better board experience by giving them time to integrate into the board and really work on their agendas. With this change, the community will elect one At-Large Director each year to a two-year term. For this to work, we need to stagger the terms of our existing At-Large Directors, Morten DK and Matthew Saunders. Since Morten is serving his second one-year term currently, the board voted in this meeting to extend the terms of Matthew Saunders 1 year. So, in our next election (in February 2015), we will elect a new At-Large Director to fill Morten''s seat for two years and Matthew will have one year left in his term.\r\n\r\n<h4>First Quarter Financials and Annual Audit</h4>\r\n\r\nIn Executive Session, the board reivewed the financials for the first quarter of 2014 and received a presentation of the 2013 Audit report from the Association''s auditor. All materials were previously reviewed by the Finance Committee (which meets monthly to review the most recent financial reports), and the Finance Committee recommended approving both the fiancials and the audit. The audit documents are now being produced as final versions (we presented draft documents to the board) and will be shared with the community at the June public board meeting at DrupalCon Austin. If you''re ready to dive into some numbers before then, you can review the first quarter financials now:\r\n\r\n<ul><li>\r\n		<a href="https://docs.google.com/a/association.drupal.org/spreadsheet/ccc?key=0AsgZDNT4xrvZdEZLS0JpMXRmZjV6MHBURjk5d0V3UEE#gid=0">January 2014 Financials</a></li>\r\n	<li>\r\n		<a href="https://docs.google.com/a/association.drupal.org/spreadsheet/ccc?key=0AsgZDNT4xrvZdDhYRVUzWUlzX0VPQk50akRZSGluS1E#gid=0">February 2014 Financials</a></li>\r\n	<li>\r\n		<a href="https://docs.google.com/a/association.drupal.org/spreadsheet/ccc?key=0AsgZDNT4xrvZdGQtX1l6SW04UGF0a0VGRHhzMWlaaWc#gid=0">March 2014 Financials</a></li>\r\n</ul>\r\n\r\nLots more happened at this board meeting, and if you''re interested, don''t forget that you can read the minutes, or watch the recording. And as always, let me know if you have questions.\r\n\r\nFrom: Assoc.drupal.org. <a href="https://assoc.drupal.org/blog/hollyrossdrupal/drupal-association-board-meeting-summary-16-april-2014" target="_blank">Click to see the full content.</a>', '', 'full_html'),
('node', 'blog', 0, 42, 42, 'und', 0, 'Though DrupalCon Latin America - Bogotá, Colombia is just under a year away, we’re already getting the ball rolling on planning and organization— and we need your help!\r\n\r\nWe’re issuing a formal RFP asking all interested parties to participate. As with every other DrupalCon, we’re seeking visually striking designs that showcase the Bogotá community, as well as the Drupal Community.\r\n\r\nYou’ll be able to add all sorts of impressive material to your portfolio, including the conference logo, splash page, site theme, web badges, social media icons and badges, newsletter banners, venue signage and banners, program book, and more.\r\n\r\nTo respond, read the RFP— you’ll find more detailed instructions inside. If you have questions or comments, respond below or in the announcement on Groups.Drupal.Org.\r\n\r\nThank you!\r\n\r\nFrom: Assoc.drupal.org. <a href="https://assoc.drupal.org/blog/leighc/submit-your-design-proposals-drupalcon-latin-america" target="_blank">Click to see the full content.</a>', '', 'filtered_html'),
('node', 'forum', 0, 43, 43, 'und', 0, 'We’ve been talking a lot about Drupal partnerships lately here at the Drupal Association, because we know that it’s a great way to help the Drupal community come together— and it’s also a great way to get noticed.\r\n\r\nThere are several options for supporting the Drupal Association and one of them is designed specifically for Drupal businesses: Supporting Partner.\r\n\r\n<strong>When you become a supporting partner, your contribution goes straight to Drupal.org.</strong>\r\n\r\nDrupal.org is funded by the community, for the community, and runs with community support. When you become a supporting partner, you fund improvements to the Drupal.org website and infrastructure, and help us to improve the site for users.\r\n\r\n<strong>Each of our Supporting Partners receives discounts on up to five DrupalCon tickets.</strong>\r\n\r\nDrupalCons are an important venue for the Drupal community: they’re important places for collaboration, innovation, and growth. Valuable connections between individuals and companies alike are made at DrupalCon. This is why every Drupal.org Supporting Partner gets discounts on up to five tickets to DrupalCon. It’s one way we say thanks for the support— and it’ll help you and your company get down in the trenches of the Drupal community and better your brand.\r\n\r\n<strong>Every Supporting Partner gets promotion at DrupalCon.</strong>\r\n\r\nOur Supporting Partners’ logos are all displayed at the Drupal Association booth during DrupalCon, and are visible in the coder lounge and on the big stage every morning before the keynote. What does that mean for you? Our Supporting Partners benefit tremendously from promotion at DrupalCon: increased visibility in the Drupal community makes it easier to build partnerships with other Drupal companies, and find great Drupal talent.\r\n\r\nFrom: Assoc.drupal.org. <a href="https://assoc.drupal.org/content/why-drupal-shops-become-supporting-partners" target="_blank">Click to see the full content.</a>', '', 'filtered_html'),
('node', 'forum', 0, 44, 44, 'und', 0, 'It’s official! According to the Drupal.org project usage stats, Drupal has more than a million sites (1,005,489 as of February 15) live and in production on the web. Here is a link to the press release. \r\n\r\nThis number under-reports reality because the project usage stats only record those sites that are running the update status module. As a result, not all Drupal sites are counted and only a fraction of sites running versions older than 6.0 are counted. For more information on how project usage stats are counted, visit the usage statistics page. \r\n\r\nCaveats aside, a million sites is an impressive chunk of the web, particularly when you look at the number of heavily trafficked sites that use Drupal. Drupal is used by some of the most well-known organizations and brands in the world including the New York Stock Exchange, LinkedIn, Al Jazeera and Whitehouse.gov.\r\n\r\nOne of the interesting things when looking at the statistics is that Drupal 6.x peaked at around 350,000 sites during a given week. Drupal 7.x is still climbing at nearly 800,000 sites. What heights will be achieved by Drupal 8 and beyond? Keep your eye on the usage stats!\r\n\r\nFrom: Assoc.drupal.org. <a href="https://assoc.drupal.org/content/million-drupal-sites-counting" target="_blank">Click to see the full content.</a>', '', 'full_html'),
('node', 'forum', 0, 45, 45, 'und', 0, 'Here is the much awaited blog post to consider our options for the location of our 2015 Latin American DrupalCon. While we have looked at the pros and cons for two locations, we want you to weigh in and tell us what you think!\r\n\r\nBefore I launch in, let me first bring you up to speed. In response to what we have been hearing consistently from the community in various parts of the world, we will add a 3rd DrupalCon to the annual roster. This DrupalCon will be focused in a region in which Drupal is gaining traction, and having a Con could help further Drupal adoption. We posted this blog in the fall, outlining the criteria used to select future locations. In this process, we determined that this 3rd Con will take place over the next 3 years in Latin America, India and either China or Singapore. Since we were unsuccessful in São Paulo before, we decided that we wanted to have Latin America as the first stop in 2015.\r\n\r\nDrupal Association Executive Director Holly Ross met with members of the Latin American community in January at Drupal Picchu. This was a fantastic meeting, with several countries represented, and it was there that São Paulo, Brazil and Bogota, Colombia were selected as the two top choices to hold this event. We’d like to pass along a big thank you to Nick Vidal (nickvidal) and Carlos Ospina (camoa) and their respective teams for their help in gathering information from both locations. I know it was a long list of questions, so, thanks to them both for the hard work in providing so many answers.\r\n\r\nI have to say, I am thrilled with the level of enthusiasm and passion that has been shown in advocating for each location.  As far as community support goes, I am confident that in either place we would have a groundswell of passionate volunteers who would help produce the event...\r\n\r\nFrom: Assoc.drupal.org. <a href="https://assoc.drupal.org/content/drupalcon-goes-latin-america-2015" target="_blank">Click to see the full content.</a>\r\n', '', 'full_html'),
('node', 'forum', 0, 46, 46, 'und', 0, 'We are excited to announce that the Drupal Association, along with key community volunteers, has selected a designer for DrupalCon Latin America!\r\n\r\nAbout a week ago, our DrupalCon Latin American selection team reached out to the community for RFP submissions. We received a number of colorful, lively and fun submissions from several regions, and had a wonderful time evaluating each proposal. Thank you to all who submitted thoughtful and exciting work.\r\n\r\nOn Tuesday, the team met to discuss the RFPs. During this process we discussed at length the designs submitted and unanimously landed on two semi-finalists.  We took the opportunity to interview both designers.\r\n\r\nAnd our new designer is...Filipe Riach (feliperiach) of Bogota, Colombia! Filipe has experience working independently and on a team to produce sophisticated and unique designs, and we know his work will be a wonderful addition to DrupalCon Latin America. You can find more information on Filipe on his website. \r\n\r\nFor those who have been following the selection process, you may be aware that Filipe is employed by the event’s fiscal sponsor SeeD. We want to make it absolutely clear that Fillipe’s selection was not influenced by this fact; the selection was unanimous on the committee and SeeD CEO Aldibier Morales recused himself from reviewing or providing input on Filipe’s entry.\r\n\r\nAgain, thank you to all who submitted design work for this project and thank you to our enthusiastic local team working hard to create a memorable DrupalCon Latin America. Stay tuned for more information soon.\r\n\r\nDrupal on,\r\n\r\nLauren\r\nlauren@association.drupal.org\r\nDrupalCon Latin America Project Manager\r\nDrupal Association Community Outreach Coordinator\r\n\r\nFrom: Assoc.drupal.org. <a href="https://assoc.drupal.org/blog/jsaylor/drupalcon-latin-america-designer-chosen" target="_blank">Click to see the full content.</a>', '', 'filtered_html'),
