(1, 'node', ' about us the new way to success lorem ipsum dolor sit amet consectetur adipiscing elit quisque rutrum pellentesque imperdiet nulla lacinia iaculis nulla non metus pulvinar cum sociis natoque penatibus et magnis dis parturient montes nascetur ridiculus mus ut eu risus enim ut pulvinar lectus sed hendrerit nibh who we are lorem ipsum dolor sit amet consectetur adipiscing elit curabitur pellentesque neque eget diam posuere porta quisque ut nulla at nunc vehicula lacinia proin adipiscing porta tellus ut feugiat nibh adipiscing sit amet in eu justo a felis faucibus ornare vel id metus vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia curae in eu libero ligula lorem ipsum dolor sit amet consectetur adipiscing elit quisque rutrum pellentesque imperdiet nulla lacinia iaculis nulla non metus pulvinar cum sociis natoque penatibus et magnis dis parturient montes nascetur ridiculus mus ut eu risus enim ut pulvinar lectus sed hendrerit nibh customer support lorem ipsum dolor sit amet consectetur adipiscing metus elit quisque rutrum pellentesque imperdiet html5 css3 js lorem ipsum dolor sit amet consectetur adipiscing elit quisque rutrum pellentesque imperdiet nulla lacinia iaculis nulla lightbox lorem ipsum dolor sit amet consectetur adipiscing elit quisque rutrum pellentesque imperdiet nulla lacinia iaculis nulla sliders lorem ipsum dolor sit amet consectetur adipiscing elit quisque rutrum pellentesque imperdiet nulla lacinia iaculis nulla icons lorem ipsum dolor sit amet consectetur adipiscing metus elit quisque rutrum pellentesque imperdiet buttons lorem ipsum dolor sit amet consectetur adipiscing elit quisque rutrum pellentesque imperdiet nulla lacinia iaculis nulla  ', 0),
(2, 'node', ' 28 killer home trading desks from all around the world consider this a friendly reminder of what really matters the place you call home for traders home is their desk it s where markets happen and markets life that s why we asked our readers to send us photos of their desks to check out how people are doing this all over the world they obliged and we put the photos together in this slideshow we re ready for another installment though so email your trading desk setup to jlaroche businessinsidercom or llopez businessinsidercom until then check out these trading spaces read more drupal wordpress joomla magento html css html5 css3 js php curabitur tincidunt pellentesque tristique permalink submitted by admin on wed 4022014 1733 donec non metus nec dui suscipit dictum cras convallis risus ut arcu dictum sed sodales diam pellentesque quisque molestie elit tellus in faucibus dolor pulvinar non log in or register to post comments curabitur ac ligula eget odio permalink submitted by admin on wed 4022014 1733 nullam leo est tempor non erat eget sagittis volutpat leo nulla facilisi sed scelerisque interdum sollicitudin log in or register to post comments pellentesque tempus neque vitae purus sagittis permalink submitted by admin on wed 4022014 1734 aliquam orci tortor tristique at lectus nec feugiat pharetra quam fusce vitae risus bibendum varius ligula nec fringilla nunc log in or register to post comments  ', 0),
(3, 'node', ' what happened to the first 10 apple employees apple unlike any other company in the world has its identity tied to one individual steve jobs and without question jobs was the driving force that turned apple into the world s most valuable tech company but jobs didn t do it alone we decided to take a look at the first 10 employees at apple and see what they did and where they are today apple s first ceo michael scott gave us a bunch of color on the early days and steve wozniak helped with a list of early employees though it was based on his memory we got our full list from another early employee the apple employee numbers aren t the order each person joined the company when scott came to apple he had to give out numbers to each employee to make life easier for the payroll department read more drupal wordpress joomla magento html css ', 0),
(4, 'node', ' the doublebreasted suit is back for spring here s how guys should wear it the suiting gods from onhigh have decided that doublebreasted suits are back this spring imagine a welltailored english gentleman got his hands on a 1920s gangster s suit and decided he could wear the jacket with a pair of jeans in other words there are levels to this stuff this isn t your grandfather s doublebreasted jacket and we strongly strongly suggest you forget the fedora you re going to want to bring this style into 2014 the right way to elaborate on this business insider caught up with judah estreicher founder of jbd clothiers for the run down on how to do that jbd is a baltimorebased men s custom clothing shop that suits businessmen and baltimore ravens alike the key with the modern doublebreasted look estreicher told us is that it s shorter and slimmer than the traditional cut you should be able to wear it casually in spring and summer too so think lighter colors gray dark blue white but casual or not said estreicher the doublebreasted pitfall will always be the cut and fit look out for the bulk of the extra fabric and the boxiness of the shoulders for best look and fit consult with a tailor this is a fit that can be more complex than the regular 1 button suit and will benefit from some expert advice and touch ups to the waist area so unless you have your jacket customfitted make sure someone with a tailor s eye gives your jacket a second look there s no point in doing this unless it s done right read more css html5 css3 js php nulla sodales enim neque permalink submitted by admin on wed 4022014 1734 morbi fermentum eget nibh sit amet mattis pellentesque molestie urna et tristique vehicula tellus velit fermentum quam sed bibendum dui massa sed sem log in or register to post comments sed semper enim eu lectus faucibus permalink submitted by admin on wed 4022014 1735 vivamus accumsan bibendum metus vestibulum mattis sem bibendum a donec ultrices eros a faucibus commodo cum sociis natoque penatibus et magnis dis parturient montes nascetur ridiculus mus log in or register to post comments mauris laoreet justo nibh permalink submitted by admin on wed 4022014 1735 curabitur at sem quis libero ullamcorper adipiscing log in or register to post comments  ', 0),
(5, 'node', ' 10 secret restaurants in new york city just in case you don t already have enough restaurants on your hit list we ve uncovered even more cool places for you to try out from restaurants in secret alleyways to eateries located behind everyday storefronts you ll be surprised to learn about these hidden dining establishments so what are you waiting for click through for our guide to secret restaurants in nyc and let the adventures begin  read more drupal wordpress joomla ', 0),
(6, 'node', ' 9 tricks elon musk jeff bezos and other top execs use to run meetings americans sit through some 11 million meetings every day with the unproductive ones costing companies 37 billion a year since we ve already looked at the most egregious meeting mistakes we decided to explore how the most successful executives run effective meetings after combing through the business literature we discovered that yahoo s marissa mayer grills her employees like an expert chef amazon s jeff bezos can t stand it when people agree and facebook s sheryl sandberg wields a mighty notebook disclosure jeff bezos is an investor in business insider through his personal investment company bezos expeditions read more joomla magento html ', 0),
(7, 'node', ' the 25 best neighborhoods for young people with may right around the corner us college graduates will be migrating to the nation s biggest cities to try to find jobs and apartments and to start life on their own niche ink a website dedicated to education analysis put together a list of the best metro areas for millennials they ranked the metro areas in the us using a dozen factors including data from the us census fbi crime rates and niche ink user opinions on the best places for life after graduation they then calculated the best neighborhood for young people in each of those cities you can read the full methodology here keep reading to see the top 25 cities and neighborhoods in the us for millennials read more ', 0),
