(38, 'node', ' drupalcon wants you as a sponsor  admin s blog drupalcon austin is right around the corner and opportunities abound for enterprising companies wanting to get their brand out in front of some of the best drupal companies and talent in the world there are many creative ways to sponsor for example the weather is probably going to be sunny with a temperature in the high 90s which means that people are going to be drinking lots and lots of water why not encourage attendees to drink in your brand by sponsoring drupalcon reusable water bottles when you support drupalcon you aren t just showing your commitment to drupal you re getting noticed every company that sponsors drupalcon gets opportunities to get the word out about your company to the largest gathering of the drupal community in north america strike up partnerships with similar companies and meet potential clients recruit talent and network with developers in the community for interested companies a variety of sponsorship opportunities are still available from distributing reusable water bottles with your logo on it to sponsoring a hackathon or even providing lunch and coffee there are a variety of opportunities remaining for companies who want to support the drupal community and get noticed in the process for more information about sponsorship opportunities visit our sponsorship page or contact our team with any questions you may have we re looking forward to hearing from you and helping you promote your company and the drupal community at drupalcon austin from assocdrupalorg click to see the full content ', 0),
(39, 'node', ' great to meet you drupal community  admin s blog my name is leigh carver leighc and i m the new content writer for the drupal association it s going to be my job to help make sure our communications are consistent interesting and valuable and to help populate drupalorg and our social media channels with informative content that helps drupalers at every point in their drupal journey i ll also be promoting the awesomeness that is the drupal community by reaching out researching and compiling creative content that illuminates how drupal is changing the world and improving lives shameless plug if you ve got a great story that you think i should tell about how drupal and the drupal community did something awesome for you or someone you know ping me i d love to talk with you about it prior to hopping on the drupal association boat i worked in drupal marketing at volacci in my hometown of austin texas where i was continually impressed by the cohesion and character of the drupal community i grew up in the tech world and in college i did my upper level coursework on the way that technology facilitates new kinds of communities like the drupal world i m thrilled that i ll be able to put this knowledge to work at the drupal association i ve worked a variety of jobs up until now from peddling romance novels to teaching english in korea and even interning with a hospice i ve consistently found myself focusing on the human needs at the heart of every position i ve found myself in i can t wait to dive in to the drupal community and get started writing about what it is that really makes drupal and the drupal community such a pleasure to work and play with in my free time i get up to all manner of mischief for fun i work some evenings on the pep squad for the texas stars minor league hockey team i volunteer with an austin organization that takes food to the homeless and very poor and i knit play video games read write and hang out with friends hobbies extend to the care and keeping of a foultempered cat and an insecure dog both of whom i spend an inordinate amount of time photographing in the coming weeks months and years you ll probably see me down in the trenches quite a bit and i m looking forward to meeting and befriending many of you if you see me in irc don t hesitate to say hi and introduce yourself if you ve got questions or just want to chat think someone should be nominated for the community spotlight or have a great story idea that you d like to share with me please feel free to email me or ping me on twitter at leighacarver i m looking forward to meeting you and working with you all to raise awareness of how drupal is great and the drupal community is the best place to be from assocdrupalorg click to see the full content ', 0),
(40, 'node', ' drupal making news in bbc school report admin s blog open source software has long been a natural choice for schools and educators teaching children about technology both share an emphasis on exploration and collaboration and access to free open source technology can be a welcome relief to schools and parents at the abraham darby academy in telford shropshire students between the ages of 11 and 16 are getting a lesson in open courseware while also teaching them about journalism their bbc school report website is running on drupal and students use the cms upload their articles and video journalism to their website and in the process they are gaining valuable experience both creating content and uploading it to the web said stephen birch a member of the information technology teaching staff at abraham darby academy the bbc school report enables students to make the news on school report news day 27th march 2014 the students report on stories that matter to them within a theme set by the bbc this year it is computing a very wide topic influenced by the new computing curriculum that comes into force for all 5 16 year old students this september we chose to use drupal to create the site as we could set it up in advance and give the students permissions to publish their work to it on the day being able to set up permissions so that the students can post without risk of taking the site down is very reassuring drupal s front end also means the students do not have to spend hours learning how to upload the content the word processing style interface is very familiar to them  drupal in advanced classes the website for the bbc school report is the latest in a long series of drupal deployments at the school in an email to the drupal association birch discussed the students passing familiarity with drupal we started using drupal as a platform for our alevel students to build websites for their assessments back in 2011 he wrote since then we have been using it for various projects including our new school website that i m developing to launch in september students enrolled in the alevel information and communication technology course at the abraham darby academy are required to create a website according to customer specifications the project takes students through every point in the system lifecycle from initial contact with companies looking for solutions to delivery of the completed project in the class students familiarize themselves with the development process and deliver a live website training schedules for end users and an owner s manual all of which they build as part of their schoolwork there is no requirement for the students to implement any original code wrote birch it is the process that is being examined that said they do need to understand how to develop a solution and we have found that drupal provides the framework to enable professional looking solutions in the timescales we have  the clear choice when it came to a cms to be used in the classroom the school cycled through a variety of other solutions including coding in dreamweaver or building websites in joomla but when a student needed better database integration the research began a few of years ago one of the students needed a solution for a membership site and whilst looking at methods of implementing a membership database that could cope with paid membership and event solutions we came across the civicrm module we tried it on drupal and joomla and drupal won the day due to the support and advice available on the drupal and civicrm forums since then we have never looked back for the students working with drupal has become a valuable educational experience and as it turns out they aren t the only ones benefitting the feedback from students about drupal has been generally positive and they soon get the hang of how to integrate the contributed modules and themes into their designs wrote birch the ease of installing modules enables the students to produce non linear solutions to the customer requirements this year it is looking like one of the clients is going to use the solution created as their business website in the meantime students will be working on their reports for the upcoming bbc news day what topics in computing will the students be reporting on said birch it would be great to use drupal as a theme for one of our stories on news day do you have a great story about drupal submit a story idea or contact leigh to let the drupal association know about it from assocdrupalorg click to see the full content suspendisse erat augue imperdiet ac erat quis permalink submitted by admin on tue 4082014 1453 duis cursus leo vitae nisi vehicula ac blandit lectus porta nam et molestie ipsum duis ornare orci ut eros pretium convallis donec eget nunc nec tellus hendrerit adipiscing vel ut risus aenean nibh lorem fermentum in sodales eu pellentesque ac metus lorem ipsum dolor sit amet nullam sodales log in or register to post comments  ', 0);
