(41, 'node', ' drupal association board meeting summary admin s blog preparing the materials for the monthly board meeting is a lot of work but it s a great chance to reflect each month on the momentum of the association and the community looking back march 2014 was particularly exciting as the community and staff are pushing forward in several directions at once with considerable momentum so let s get down to it and share some of the highlights  program updates each month we review the metrics outlined in our 2014 leadership plan and share updates from the teams we re pleased to say that most of our metrics are in the green within 95 of goal particularly exciting is the news about drupalcon austin numbers looked very solid at the end of march the end of our reporting period for this meeting but we are also able to share that earlybird pricing ended just a few days after this dashboard closed and we beat our estimates meaning that we are more than ontrack to have a 4000 person event this june another biggest drupalcon ever we are also really pleased with the momentum around the drupalorg metrics this is still our area of greatest concern we have more red metrics here than anywhere else however march brought some tremendous gains that if sustained will move our metrics quickly towards green in particular we focused discussion on  page response time  our goal is 307 seconds our current average for the year is 393 seconds this number is pulled from our pingdom account part of the reason that we re so far from goal is that we had some serious issues in january that pushed the numbers way up our hardware improvments thanks to the diwg and rudy  have helped speed this up and the upcoming cdn deployment will bring this number down even further especially for individuals accessing the site outside of the us  testbot performance  goal is 70 minutes but actual average for the year is about 138 minutes this actual is also very inflated by lots of issues we had in january that pushed the total testbot time much higher thanks to work done at drupal dev days in szeged by jeremy thorson and ricardo amaro  along with some changes to d8 core the actual tesbot run time average in march was just 47 minutes  home page bounce rate  this metric is one of the central motivations for the user research that the dcwg has begun as part of a larger drupalorg reinvention  we have also begun to put tools like optimizely in place that will allow us to run tests and experiments based on our research which should help us address bounce rate time on site and other engagement metrics for our various audiences we likely won s see shifts here for some months but we are definitely thinking about these metrics and working to put the foundation for a solution in place  procurement policy at the association we work hard to ensure that our actions are in line with the drupal community values this is of course particularly important when money is part of the equation to that end the association has a financial policies document that is reviewed annually by the board finance committee and sets rules for transparently and openly making decisions for how association money gets spent until now one element that was lacking was a procurement policy to govern when we pay for a service vs work with a volunteer and how and when we can take inkind donations back in february we looked for feedback from the community and incorporated a lot of the suggestions into a final policy which was approved by the board in the meeting i would like to add that this policy though approved by the board is just a starting place there is so much nuance that we will encounter as we put the policy into practice during our annual review of policies we will have the opportunity to revisit and refine this language in particular we want to ensure that we are supporting and growing the volunteers who contribute to the project and not hiring contractors at the expense of the health of our community atlarge elections terms in the march board meeting we updated atlarge term length and shifted the election cycle the goal is to give our atlarge directors a better board experience by giving them time to integrate into the board and really work on their agendas with this change the community will elect one atlarge director each year to a twoyear term for this to work we need to stagger the terms of our existing atlarge directors morten dk and matthew saunders since morten is serving his second oneyear term currently the board voted in this meeting to extend the terms of matthew saunders 1 year so in our next election in february 2015 we will elect a new atlarge director to fill morten s seat for two years and matthew will have one year left in his term first quarter financials and annual audit in executive session the board reivewed the financials for the first quarter of 2014 and received a presentation of the 2013 audit report from the association s auditor all materials were previously reviewed by the finance committee which meets monthly to review the most recent financial reports and the finance committee recommended approving both the fiancials and the audit the audit documents are now being produced as final versions we presented draft documents to the board and will be shared with the community at the june public board meeting at drupalcon austin if you re ready to dive into some numbers before then you can review the first quarter financials now  january 2014 financials february 2014 financials march 2014 financials lots more happened at this board meeting and if you re interested don t forget that you can read the minutes or watch the recording and as always let me know if you have questions from assocdrupalorg click to see the full content suspendisse id neque gravida permalink submitted by admin on tue 4082014 1453 nullam sit amet scelerisque enim quisque pellentesque convallis urna nec laoreet purus accumsan sed nulla auctor orci vitae porttitor egestas enim diam hendrerit velit in tristique neque leo ac lorem sed sit amet dui eu eros commodo dapibus quis sed magna nam ornare leo ipsum at massa nunc log in or register to post comments  ', 0),
(42, 'node', ' submit your design proposals for drupalcon latin america  admin s blog though drupalcon latin america bogotá colombia is just under a year away we re already getting the ball rolling on planning and organization and we need your help we re issuing a formal rfp asking all interested parties to participate as with every other drupalcon we re seeking visually striking designs that showcase the bogotá community as well as the drupal community you ll be able to add all sorts of impressive material to your portfolio including the conference logo splash page site theme web badges social media icons and badges newsletter banners venue signage and banners program book and more to respond read the rfp you ll find more detailed instructions inside if you have questions or comments respond below or in the announcement on groupsdrupalorg thank you from assocdrupalorg click to see the full content integer ullamcorper pellentesque nisl permalink submitted by admin on tue 4082014 1451 in in ante vitae erat rutrum elementum nam sit amet massa elit phasellus rhoncus eget diam id dapibus maecenas venenatis ultrices aliquam proin dignissim sem non facilisis interdum fusce vitae rhoncus risus praesent congue molestie tellus vitae venenatis duis nulla mi tempor dictum volutpat log in or register to post comments nulla facilisi vestibulum suscipit eget permalink submitted by admin on tue 4082014 1452 quisque vulputate risus quis magna porttitor eu mattis metus imperdiet donec fermentum nulla sem quis convallis libero convallis at donec tincidunt at ipsum at hendrerit mauris scelerisque quam ipsum id fermentum mauris semper et vivamus consequat tortor lorem a condimentum ipsum massa nunc log in or register to post comments praesent eget imperdiet felis permalink submitted by admin on tue 4082014 1453 proin suscipit diam est at euismod odio vehicula vitae morbi tincidunt facilisis nibh sit amet rhoncus in hac habitasse platea dictumst mauris vel lacus risus fusce pellentesque