(43, 'node', ' why drupal shops become supporting partners general discussion we ve been talking a lot about drupal partnerships lately here at the drupal association because we know that it s a great way to help the drupal community come together and it s also a great way to get noticed there are several options for supporting the drupal association and one of them is designed specifically for drupal businesses supporting partner when you become a supporting partner your contribution goes straight to drupalorg drupalorg is funded by the community for the community and runs with community support when you become a supporting partner you fund improvements to the drupalorg website and infrastructure and help us to improve the site for users each of our supporting partners receives discounts on up to five drupalcon tickets drupalcons are an important venue for the drupal community they re important places for collaboration innovation and growth valuable connections between individuals and companies alike are made at drupalcon this is why every drupalorg supporting partner gets discounts on up to five tickets to drupalcon it s one way we say thanks for the support and it ll help you and your company get down in the trenches of the drupal community and better your brand every supporting partner gets promotion at drupalcon our supporting partners logos are all displayed at the drupal association booth during drupalcon and are visible in the coder lounge and on the big stage every morning before the keynote what does that mean for you our supporting partners benefit tremendously from promotion at drupalcon increased visibility in the drupal community makes it easier to build partnerships with other drupal companies and find great drupal talent from assocdrupalorg click to see the full content ', 0),
(44, 'node', ' a million drupal sites and counting  general discussion it s official according to the drupalorg project usage stats drupal has more than a million sites 1005489 as of february 15 live and in production on the web here is a link to the press release this number underreports reality because the project usage stats only record those sites that are running the update status module as a result not all drupal sites are counted and only a fraction of sites running versions older than 60 are counted for more information on how project usage stats are counted visit the usage statistics page caveats aside a million sites is an impressive chunk of the web particularly when you look at the number of heavily trafficked sites that use drupal drupal is used by some of the most wellknown organizations and brands in the world including the new york stock exchange linkedin al jazeera and whitehousegov one of the interesting things when looking at the statistics is that drupal 6x peaked at around 350000 sites during a given week drupal 7x is still climbing at nearly 800000 sites what heights will be achieved by drupal 8 and beyond keep your eye on the usage stats from assocdrupalorg click to see the full content ', 0),
(45, 'node', ' drupalcon goes to latin america in 2015 maecenas justo augue auctor mattis magna quis here is the much awaited blog post to consider our options for the location of our 2015 latin american drupalcon while we have looked at the pros and cons for two locations we want you to weigh in and tell us what you think before i launch in let me first bring you up to speed in response to what we have been hearing consistently from the community in various parts of the world we will add a 3rd drupalcon to the annual roster this drupalcon will be focused in a region in which drupal is gaining traction and having a con could help further drupal adoption we posted this blog in the fall outlining the criteria used to select future locations in this process we determined that this 3rd con will take place over the next 3 years in latin america india and either china or singapore since we were unsuccessful in são paulo before we decided that we wanted to have latin america as the first stop in 2015 drupal association executive director holly ross met with members of the latin american community in january at drupal picchu this was a fantastic meeting with several countries represented and it was there that são paulo brazil and bogota colombia were selected as the two top choices to hold this event we d like to pass along a big thank you to nick vidal nickvidal and carlos ospina camoa and their respective teams for their help in gathering information from both locations i know it was a long list of questions so thanks to them both for the hard work in providing so many answers i have to say i am thrilled with the level of enthusiasm and passion that has been shown in advocating for each location as far as community support goes i am confident that in either place we would have a groundswell of passionate volunteers who would help produce the event from assocdrupalorg click to see the full content pellentesque pellentesque mi pharetra elit tincidunt permalink submitted by 