(46, 'node', ' drupalcon latin america designer chosen general discussion we are excited to announce that the drupal association along with key community volunteers has selected a designer for drupalcon latin america about a week ago our drupalcon latin american selection team reached out to the community for rfp submissions we received a number of colorful lively and fun submissions from several regions and had a wonderful time evaluating each proposal thank you to all who submitted thoughtful and exciting work on tuesday the team met to discuss the rfps during this process we discussed at length the designs submitted and unanimously landed on two semifinalists we took the opportunity to interview both designers and our new designer is filipe riach feliperiach of bogota colombia filipe has experience working independently and on a team to produce sophisticated and unique designs and we know his work will be a wonderful addition to drupalcon latin america you can find more information on filipe on his website for those who have been following the selection process you may be aware that filipe is employed by the event s fiscal sponsor seed we want to make it absolutely clear that fillipe s selection was not influenced by this fact the selection was unanimous on the committee and seed ceo aldibier morales recused himself from reviewing or providing input on filipe s entry again thank you to all who submitted design work for this project and thank you to our enthusiastic local team working hard to create a memorable drupalcon latin america stay tuned for more information soon drupal on lauren lauren associationdrupalorg drupalcon latin america project manager drupal association community outreach coordinator from assocdrupalorg click to see the full content integer congue luctus permalink submitted by admin on mon 4142014 1123 lorem ipsum dolor sit amet consectetur adipiscing elit nulla faucibus velit quis nunc semper eget egestas nunc hendrerit praesent tincidunt puru