(49, 'node', ' thank you supporting partners  view the full image view the full image view the full image view the full image view the full image we ve been sharing lots of big news at the drupal association lately from hiring a cto to lead the drupalorg tech team to implementing a content delivery network cdn for parts of drupalorg we re making big exciting improvements at the association and they wouldn t be possible without our supporting partners supporting partner funding makes all sorts of improvements to drupalorg possible and as a result helps us to serve the drupal community even better we d like to extend a big thanks to our supporting partners for all their help big kudos go to our newest supporters who include  aquilent   aten design group   digital circus   exove ltd   fenomen   level ten   mays digital   metal toad   network publications ltd   new media    pingv   trellon llc   unleashed technologies  and wunderkraut gmbh  here are some of the great products our supporting partners dues are funding  hiring a cto implementing a cdn improved development environments both hosted and local development of a full staging environment without our supporting partners we wouldn t be able to do so many of the great things we work on for the community to learn more about becoming a supporting partner please check out the supporting partner page from assocdrupalorg click to see the full content ', 0),
(50, 'node', ' defining our roles in the drupal community view the full image view the full image we need a better way to work together this is a dense topic and this post is very long so let me provide a short summary here before you all tl dr me which would be deserved the long and short of it is that association staff and other community members have to figure out a better way of working together this post is meant to start a discussion that will lead to clear definitions we can use to better understand each other and our collaborative work i will certainly explain more below but you can skip to the bottom if you want to get to the logistics now for those who love detail a bit more about the problem i ve been at the association for a little over a year now and i ve heard a lot and learned a lot during this time on the whole the feedback i ve heard has been incredibly positive about the future of drupal and the role of the drupal association in supporting that future i ve also heard criticism of the association i welcome constructive criticism because i firmly believe it leads to reflection and improvement that s what we ve been striving for at the association improving the services and support we provide to the community with the community to that end we have had wide ranging conversations with many of you about everything from how to staff the tech team to improve drupalorg to how session selection should work for drupalcon in all those conversations covering so many disparate topics there seem to be a couple of constants a lack of clarity about the mission of the drupal association a lack of clarity about the role of association staff alongside community volunteers in other words we lack a clear vision and mission framework that articulates our role within the community and how we work alongside volunteers here s the way i summarize this conundrum i ll use drupalorg as the example because that is where we are focused in 2014 we have recent examples that highlight the kind of tensions and problems that can occur without this clarity however i think we could use these same types of diagrams to explain drupalcons and other programs beyond our work on drupalorg we have to start somewhere so i am going to start with a gross oversimplification essentially there are three kinds of work to be done on drupalorg i know there are more but i am starting with a gross oversimplification from assocdrupalorg click to see the full content ', 0),
(51, 'node', ' how drupal and open source are helping youth rise from poverty in africa view the full image view the full image view the full image the rise of open source and the skyrocketing popularity of drupal as a cms has made for many very happy developers working in the open source world but for some people it isn t just a hobby or a way to bring home a paycheck it s a ticket out of crushing poverty for some youth living in informal settlements in kampala uganda the kampabits organization has made an incredible difference in their lives the program takes impoverished young individuals who are unable to access funding or build the necessary skills to find gainful employment and helps them become web designers and web developers drupal is one of the open source platforms they use with the number of alumni of the program employed or entrepreneurs in their own rights the program is clearly making a difference in its students lives in spite of the challenges kampabits has registered a 75 success rate of program alumni finding jobs or starting their own business said kampabits coordinator and manager alex okwaput providing durable solutions to social problems according to okwaput kampabits partners with community based organizations cbo s that operate in the informal settlements which are very poor slumlike communities the cbos refer atrisk youth to the kampabits team who then visit with the candidates to determine whether they are eligible or able to participate in the one year training program the selection process is really rigorous said hanja holm the operational director of butterfly works the organization that founded the bits programs it s important to find those youth that come from informal settlements but have good motivation to finish this course gain the creativity to succeed and are willing to give back to the community and the concept behind the bits programs the program is one of several programs that derived from nairobits a program that was implemented in 2000 by three women who would go on to become cofounders of butterfly works the selfdescribed social innovation studio was founded in 2003 to find and implement durable solutions for social problems originally started as an art project to show the world the lives and the neighborhoods of poor youths in kenya the program quickly morphed into a way of collaborating with young people in poor settlements so that they could gain the creativity and skills to lift themselves out of poverty well over a decade after nairobits opened its doors there are several bits programs spread across africa and more opening up elsewhere as the name implies the nairobits program serves nairobi kenya the zanzabits center for film multimedia serves zanzibar tanzania kampabits serves kampala uganda and aruabits the most recent program was opened in october of 2013 serves the city of arua in northern uganda the first bits program to be implemented outside of east africa will be indusbits located in pakistan doing good being great to make sure instructors have access to the resources they need the butterfly works team has created a digital learning environment called bits academy where instructors can access teaching materials showcase student work upload tutorials and modify the existing curriculum to fit local needs the team takes a practical approach to the curriculum wherever possible students are taught costsaving open source platforms like drupal though they re also given instruction in widely used paid software such as microsoft office said holm of the popular content management systems that the team researched and uses for the program drupal features among the three powerful ones okwaput told the association drupal is open source so there are almost no costs which is a plus it is good for customizing web solutions and there is always a module that can help the kampabits training consists of information communication technology and multimedia web design and development where drupal is introduced as one of the cmss basic entrepreneurship conducted by digital opportunity trust dot  http ugandadotrustorg  and life skills in general after the one year training the students are linked to it initiatives for internships wrote okwaput after completing the internship students are able to seek out employment go freelance or even become entrepreneurs in their own right through the program the youth are learning skills that make them more employable said holm almost all of youth that finish the yearlong program find jobs which aren t only in web design and development our alumni find that they re eligible for many different jobs because they learn creative thinking and concept development and some of them even start their own businesses and are those new workers successful according to holm when it comes to the nairobits programs employers really like working with the graduates and we ve seen the same thing in kampala students in the program learn web design by doing whereas in the universities students only learn theory the companies really like that our graduates actually have the experience to do the work in spite of the challenges such as lack of donor funding limited facilities for training erratic power supply and difficulties dealing with business partners the programs are making a huge difference in the lives of atrisk youth and those benefits are trickling into the surrounding communities one alumna of the kampabits program best aiyorwoth won a prize of 25000 for starting up her own business creating much needed valuable jobs in her community the entrepreneurship aspect is really important in the current economy because everywhere in the world there s lots of youth unemployed so they have to make their own jobs holm said to get involved or to make a donation please visit the kampabits website the bits academy or contact butterfly works for more information on the programs from assocdrupalorg click to see the full content ', 0),
(52, 'node', ' drupal dev days szeged view the full image view the full image view the full image this week s notes will be all about something unique which happened last week a 7 day long sprint for drupalorg the sprint happened during drupal developer days an amazing event which this year took place in szeged hungary overall more than 300 people took part in the conference with 3 days of sessions but the main focus of the event was on contribution sprints all week long people we working on drupal 8 core drupal 8 search and entity field api documentation migration mongodb rest and authentication rules for drupal 8 and of course drupalorg i came specifically to lead the sprint on drupalorg and it turned out to be much more successful than i expected so what did we do sprints started on monday and the start was exciting there were 20 drupalorg development environments created on our development server for the sprints on monday people started working on them and they were working so hard as well as all other sprinters who were massively doing git checkouts of drupal 8 that drupalorg hit its vlan transit limit on outgoing traffic because of that the website was very slow for everyone in the world for a few hours we were essentially a dos attack on drupalorg then our infrastructure team worked to up the limit and we could work again after such a nice start we managed to get a lot done there were 3 main focuses for the sprint cleaningup leftover issues from drupal 7 upgrade making bluecheese drupalorg s theme responsive modernizing drupalorg testbot from assocdrupalorg click to see the full content ', 0),
(53, 'node', ' building the future of drupal view the full image view the full image if drupal adoption is going to increase we ll need to grow the community and that means continuing to bring developers web designers and digital experts into the drupal fold for the finale of our series on drupal training options we spoke to several of the many experts in drupal training and wanted to share their thoughts with the community when it comes to increasing the amount of drupal talent in the market there are more options to learn the platform than ever before prior to some of the formal training options we have now everyone got their start with community documentation irc and the original drupalorg content that wasn t necessarily curated said andrew wilson a senior account manager at drupalizeme the drupal association drupalizeme buildamodule and other new players are helping make drupal more accessible to more people there s a tremendous volume of resources for people who learn drupal said doug vann a wellknown drupal trainer consultant and developer and there s surprisingly little overlap between some buildamodule drupalizeme drupal planet and the many other resources really complement each other quite well and for those interested in diving into drupal not only do training options abound but so does incentive demand for drupal developers has always been high and though there s a bit of a learning curve deeper in building simple sites with out of the box drupal can be easy and intuitive making it a friendly jumping off point for new developers according to ben ortega acquia s director of learning services what drupal does for folks that run into execution issues who have their concept but get hung up on building a website is that it helps them hack together a web presence quickly and make that idea more real even people who aren t tech savvy can use drupal it s something that can spur innovation because with a little creativity drupal can make great things happen  dive in  while resources abound for those learning drupal we asked doug vann what s the best way for someone who already knows a bit about drupal to increase his or her skill set get on the hook to build something for someone whether it s free or cheap put yourself in a situation where you have to deliver or produce vann recommends bite off more than you can chew though it can go wrong maybe you can find a sweet spot offer to do something for your church or for someone who wants a free site pop into the forums go to your local meet up and ask for help with your problems it forces you to solve problems instead of sending you wandering through the toy store of drupal you won t learn anything unless you do it all in all the future of drupal is looking bright with major anticipation mounting around the drupal 8 release new programs in place to sustain and grow the drupal community demand for drupal expertise high and new training options springing up every day things are certainly looking up in terms of growing and sustaining a healthy community the neat thing is that there are programs like drupalizeme buildamodule acquia and so on out there but there are other organizations doing things out there on a smaller scale and what they re accomplishing is really cool said wilson we just passed one million drupal websites and so many people could use drupal training that the more groups that provide training help the better our homegrown solutions are going to take care of training for drupal added vann the true homegrown heroes who live breathe and eat drupal they are your best source those who live it eat it and believe it may the nodes be ever in your favor in the drupal games he added from assocdrupalorg click to see the full content ', 0),
